webpackJsonp([0xec4f51ef7434],{5831:function(e,t){e.exports={data:{post:{html:'<p>After an experience with small children in a crowded restaurant, <a href="http://www.yarinareth.net/caveatlector/archive/week_2002_11_24.html#e001092">Dorothea</a> says she doesn\'t care about my kid. Well, I don\'t care about her peace and quiet in a public place. I guess that makes us even. Maybe she\'d prefer that Christopher stay home and bake muffins. Well, then.</p>\n<p><img src="http://www.papascott.de/images/crhmuffin1102.jpg" border="0" alt="Christopher stays home and bakes muffins" title="Christopher stays home and bakes muffins" /></p>',fields:{title:"Muffin Man",date:"25 Nov 2002",url:"https://papascott.de/2002-11-25-muffin-man/"}}},pathContext:{slug:"/2002-11-25-muffin-man/",prev:{fields:{title:"5 Hours for a Lampshade",date:"24 Nov 2002",slug:"/2002-11-24-5-hours-for-a-lampshade/"}},next:{fields:{title:"Counting with Christopher",date:"26 Nov 2002",slug:"/2002-11-26-counting-with-christopher/"}}}}}});
